import Icon from '../Icon/Icon';
import './NavButton.scss';
const NavButton = ({icon, label}:{icon: string, label: string}) => {
    return (
        <div className='navButtonContainer'>
            Hello
            <Icon icon={icon}/>
            <div className='navButtonLabel'>
                {label}
            </div>
        </div>
    )
}
export default NavButton;
